This sounds great, and I have to agree with @MickeySmith and @travisrogers on the design by committee aspect and rushing it. I‚Äôve been in the branding world for many years and that never ends well. A brand can be super simple but it still needs to be considered. I agree that it‚Äôs less important in Web3 but it‚Äôs still vital that what we create is üíØ own-able, does not have any visual connection to existing brands, and is easily recognizable as RAW. 

@shanelavalette suggestion is great, and it would give us time to do a proper brand dive and presentation formation with reverts. That‚Äôs how we‚Äôve always worked. I‚Äôm more than happy to get my team on this brief but as we need to conscious of my teams time and capacity a RFP / basic brief would be great we can then come back with a proposal for both costs and timelines (we can get these from a couple of designers and decide on which to go with. - again this doesn‚Äôt have to be crazy expensive at all as it can be a simple brand which we can build and expand on as we go forward - but then that expansion needs to come from a core team so that we don‚Äôt end up with a butchered brand regardless üòÜ

To simplify things I suggest we vote on a committee to handle brand decisions, that way whomever does the design (my team or someone else) at least there‚Äôs only a few people giving feedback and we can move more efficiently. That‚Äôs my two cents! happy to hear feedback!
